// Environment


// Components

  
  
  
  
  
  
const IntroText = () => {
    return (
      <div className="about-div">

        <p>
           A tech head with a heart for the arts.
        </p>
        <p>
          Being the artsy fartsy nerd that I am, programming has always been in my mind. Deciding to jump into Computer Science rabbit hole, landed on the Frontend Development path gunning my way back to the Creative industry.
        </p>
        <div>
          <p>
            Cheers!
          </p>
        </div>

      </div>
    );
  }
  // this get exported to app
  export default IntroText;
